#include <iostream>

const char data[] = R"(




)";

const int pad[3][3] = {{7,8,9},{4,5,6},{1,2,3}}; 

int main() {
  int x = 1, y = 1;
  for(auto c : data) {
    switch(c) {
       case 'R': if(x<2) x++; break;
       case 'L': if(x>0) x--; break;
       case 'U': if(y<2) y++; break;
       case 'D': if(y>0) y--; break;
       case '\n': std::cout << pad[y][x]; break;
       case '\0': std::cout << std::endl; break;
       default: std::cerr << "Unhandeled input " << (int)c << std::endl;
    }
  }
  return 0;
}